import React, { useEffect, useState } from "react";
import { getUsers } from "./services/userService";

const App = () => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        getUsers().then(setUsers);
    }, []);

    return (
        <div>
            <h1>User List</h1>
            {users.map(user => (
                <p key={user._id}>{user.name} - {user.email}</p>
            ))}
        </div>
    );
};

export default App;
